package com.jty.model;import java.io.Serializable;import java.util.Date;import javax.persistence.Entity;import javax.persistence.Id;@SuppressWarnings("serial")@Entity(name = "useragent")public class UserAgent implements Serializable {    @Id	private Long id;    private Long userId;    private Integer agentLevel;    private Long tjUserId;    private Date createTime;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Long getUserId() {		return userId;	}	public void setUserId(Long userId) {		this.userId = userId;	}	public Integer getAgentLevel() {		return agentLevel;	}	public void setAgentLevel(Integer agentLevel) {		this.agentLevel = agentLevel;	}	public Long getTjUserId() {		return tjUserId;	}	public void setTjUserId(Long tjUserId) {		this.tjUserId = tjUserId;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}}